import React from "react";
import "./checklist.css";

const Check = () => {
  return (
    <table>
      <th>checklist</th>
      <tr>
        <label>
          <input type="checkbox" />
          check 1
        </label>
      </tr>

      <tr>
        <input type="checkbox" />
        check 2
      </tr>
      <tr>
        <input type="checkbox" />
        check 3
      </tr>
    </table>
  );
};

export default Check;
